import React from 'react';

const RegristerForm = () => {
    return (
        <div className=''>
            {isSubmitting && <LinearProgress className=''/>}
            <Avatar className={classes.avatar}>
                <LockOutlined></LockOutlined>
            </Avatar>
            <Typography className='' component="h3" variant="h5">
                Create an Account
            </Typography>

            <form >
                <InputField name="fullName" label="Full Name" form={form} />
                <InputField name="email" label="Email" form={form} />
                <PasswordField name="password" label="Password" form={form} />
                <PasswordField name="retypePassword" label="Retype Password" form={form} />
                <Button disabled={isSubmitting} type="submit" className={classes.submit} variant="contained" color="primary" size="large" fullWidth> 
                    Create an Account
                </Button>
            </form>
        </div>
    );
};

export default RegristerForm;
